import React from 'react';
import logo from './logo.svg';
import {Provider,defaultTheme,Grid} from '@adobe/react-spectrum';
import './App.css';
import LoginForm from './components/Loginform';

function App() {
  return (
    <div className="App">
      <Provider theme={defaultTheme}>
        <Grid areas={[ 'content']}

        >

        </Grid>
        <LoginForm />
      </Provider>
    </div>
  );
}

export default App;
